INSERT INTO `news` VALUES ("1", "2015-09-13 21:49:15", "0000-00-00 00:00:00", NULL, "1", NULL, "2015-08-16 21:48:01", "¿Cómo puede el olor del mar ayudar a enfriar la Tierra?", "Los océanos desprenden un tipo de gas que contribuye a la formación de nubes con características especiales ", "<p>Nada como el olor del mar. Su aroma se debe, por lo general, al dimetil sulfuro, un gas maloliente generado por las bacterias que se alimentan de fitoplancton.</p>\n\n<p>En la atm&oacute;sfera, este gas cambia su composici&oacute;n qu&iacute;mica y se transforma en sulfato, una sustancia que da origen a las nubes.</p>\n\n<p>La materia org&aacute;nica s&oacute;lida de las grandes colonias de fitoplancton tambi&eacute;n puede contribuir a la formaci&oacute;n de nubes.</p>\n\n<p>Su proliferaci&oacute;n en los oc&eacute;anos puede crear una suerte de espuma sucia que, por el movimiento del <strong>mar</strong>, despide peque&ntilde;as burbujas hacia el aire.</p>\n\n<p>El vapor de agua se condensa a su alrededor, creando peque&ntilde;as gotas que acaban formando nubes.</p>\n\n<p><strong>Sorpresa</strong></p>\n\n<p><img alt=\"\" src=\"data:image/png;base64,\" /></p>\n\n<p>&iquest;Qu&eacute; tiene que ver esta escena con el calentamiento global? Seg&uacute;n investigadores, el tipo de nubes que se forman por los gases del mar y las part&iacute;culas de plancton, sobre todo en el oc&eacute;ano Ant&aacute;rtico, son especiales.</p>\n\n<p>La capacidad de las nubes de reflejar la luz del Sol hacia el espacio depende del tama&ntilde;o de sus gotas y de la cantidad de l&iacute;quido que albergan.</p>\n\n<p>Cuanto m&aacute;s l&iacute;quido tienen, son m&aacute;s brillantes y m&aacute;s reflectantes.</p>\n\n<p>Los expertos sab&iacute;an que en invierno, cuando el mar est&aacute; m&aacute;s agitado y salpica m&aacute;s agua, se crea una mayor cantidad de esta clase de gotas y por ende m&aacute;s Sol acaba reflejado hacia el espacio.</p>\n\n<p>Cuando el mar est&aacute; m&aacute;s tranquilo, durante la temporada estival, se espera que las nubes tengan una menor capacidad reflectora.</p>\n\n<p>Por esta raz&oacute;n, un equipo de investigadores que estudi&oacute; este fen&oacute;meno en el oc&eacute;ano Ant&aacute;rtico, qued&oacute; muy sorprendido al descubrir que esto no era exactamente as&iacute;.</p>\n\n<p>De hecho, concluyeron que el efecto de las part&iacute;culas de plancton es m&aacute;s fuerte en los meses de verano. Descubrieron que, en promedio, durante esta estaci&oacute;n, la vida oce&aacute;nica duplica el n&uacute;mero de gotas.</p>\n\n<p><img alt=\"\" src=\"data:image/png;base64,\" /></p>\n\n<p>&quot;La cantidad de luz reflejada por esas nubes en esa regi&oacute;n es de 125 vatios por metro cuadrado&quot;, explica Susannah Burrows, coautora del estudio del Departamento de Energ&iacute;a del Laboratorio Nacional del Pac&iacute;fico del Noroeste en Estados Unidos.</p>\n\n<p>&quot;Lo que estamos encontrando es evidencia de un cambio en su capacidad reflectora de 10 vatios por metro cuadrado, que puede ser atribuido al fitoplancton&quot;.</p>\n\n<p>&quot;&iexcl;No es poca cosa!&quot;, exclama la investigadora.</p>\n", NULL, NULL, "1");
