INSERT INTO `news` VALUES ("2", "2015-09-13 21:52:24", "0000-00-00 00:00:00", NULL, "1", NULL, "2015-08-16 21:48:01", "¿Es realmente el Everest la montaña más alta del mundo?", "Todo depende de cuál sea el punto desde donde se mide, y puede que existan otras elevaciones de mayor envergadura", "<p>Cuando India era una colonia brit&aacute;nica, un equipo de agrimensores decidi&oacute; medir la altura de todas las cumbres del Himalaya.</p>\n\n<p>Se interesaron particularmente por una que superaba a todas los dem&aacute;s: la cima XV.</p>\n\n<p>Calcularon su altitud en 9.000 metros por sobre el nivel del mar, lo cual la convirti&oacute; en la monta&ntilde;a m&aacute;s alta del mundo.</p>\n\n<p>En 1865 le cambiaron el nombre por el de Everest, en honor a George Everest, un experto gal&eacute;s que se encarg&oacute; de casi toda la topograf&iacute;a de India.</p>\n\n<p>Desde entonces, numerosos escaladores han intentado conquistar su cima para demostrarle al mundo que han puesto un pie la monta&ntilde;a m&aacute;s alta del planeta.</p>\n\n<p>&iquest;Pero es el Everest realmente merecedor de este t&iacute;tulo?</p>\n\n<p>Las distintas formas de medir una monta&ntilde;a</p>\n\n<p>El Everest es la monta&ntilde;a m&aacute;s alta del mundo si la medimos desde el nivel del mar.</p>\n\n<p>Sin embargo, hay otras monta&ntilde;as m&aacute;s altas que esta, si utilizamos otro par&aacute;metro para calcular su altura.</p>\n", "new_1442199144_619x347.jpg", NULL, "1");
#
#
INSERT INTO `news` VALUES ("3", "2015-09-13 21:53:57", "0000-00-00 00:00:00", NULL, "1", NULL, "2014-10-09 21:48:01", "Invertirán S/. 633 mlls. en 17 nuevos edificios en San Isidro", "En dos años estarán listas las construcciones que harán que el distrito tenga 50 edificios de más de diez pisos. Un millón de personas conforman la población flotante en el distrito. También se actualizará el Plan Director de Vialidad, Tránsito y Transporte.", "<p>Publicado: 09 Oct 2013<br />\nFuente: gestion.pe</p>\n\n<p>En dos a&ntilde;os estar&aacute;n listas las construcciones que har&aacute;n que el distrito tenga 50 edificios de m&aacute;s de diez pisos. Un mill&oacute;n de personas conforman la poblaci&oacute;n flotante en el distrito. Tambi&eacute;n se actualizar&aacute; el Plan Director de Vialidad, Tr&aacute;nsito y Transporte.</p>\n\n<p>En el marco de un planeamiento urbano que incorpora exigencias ambientales, ya se tiene un grupo de 17 proyectos y anteproyectos de edificios de m&aacute;s de diez pisos para albergar a m&aacute;s oficinas en el centro financiero de San Isidro, revel&oacute; a Gesti&oacute;n el gerente municipal de ese distrito, Diethell Columbus Murata.</p>\n\n<p>La construcci&oacute;n de los 17 nuevos edificios (ver tabla) demanda una inversi&oacute;n de S/. 633 millones, y se prev&eacute; que estar&aacute;n listos dentro de dos a&ntilde;os, aunque algunos que ya est&aacute;n en obra podr&aacute;n inaugurarse durante el pr&oacute;ximo a&ntilde;o.</p>\n\n<p>&ldquo;Estas inversiones est&aacute;n acordes a lo que dispone el Plan Urbano Distrital 2012-2022. Es decir, habr&aacute; un tratamiento de aguas grises para no sobrecargar la red de alcantarillado del distrito, as&iacute; como el fomento de los techos verdes&rdquo;, manifest&oacute; Columbus Murata.</p>\n\n<p>&nbsp;Actualmente, en el distrito existen 33 edificios de m&aacute;s de 10 pisos, por lo que con los nuevos proyectos y anteproyectos en San Isidro se pasar&aacute; a tener en total 50 edificaciones con esos niveles.</p>\n\n<p>&nbsp;&ldquo;Con este plan estamos buscando que en San Isidro las edificaciones se vuelvan ecoamigables y sostenibles. Las empresas constructoras no solo deben buscar albergar gente, ya sea en lo residencial y comercial sino que tambi&eacute;n deben propender a un tema de calidad de vida&rdquo;, a&ntilde;adi&oacute;.</p>\n\n<p><strong>&nbsp;Proyectos</strong></p>\n\n<p>En el paquete de proyectos destaca el que se viene realizando en el cruce de las avenidas Javier Prado y Paseo de la Rep&uacute;blica, a cargo de Inmueble Limatambo S.A.<br />\nSe trata del edificio Limatambo, que est&aacute; siendo demolido para dar paso a un edificio de 41 pisos que ser&aacute; el edificio comercial m&aacute;s alto del Per&uacute;.</p>\n\n<p>Otro proyecto importante est&aacute; ubicado en la avenida Paseo de la Rep&uacute;blica, manzana 43, lote 1-2, que est&aacute; a cargo de la empresa inmobiliaria Interproperties, perteneciente al Grupo Interbank.</p>\n\n<p>&ldquo;All&iacute; habr&aacute; dos torres de oficinas, y sobre el 70% del techo de esa construcci&oacute;n se usar&aacute; para &aacute;reas verdes. Pero no sabemos si ser&aacute; una nueva oficina del banco. Eso no se determina en la etapa del proyecto porque no se registra la raz&oacute;n social de qui&eacute;n va a ocupar cada uno de los espacios&rdquo;, detall&oacute; Columbus Murata.</p>\n\n<p>A nivel general, los edificios comerciales est&aacute;n dejando un porcentaje de &aacute;rea libre en los pisos superiores para la integraci&oacute;n de los trabajadores de las empresas.</p>\n\n<p><strong>Tr&aacute;nsito</strong></p>\n\n<p>El Plan Urbano Distrital 2012-2022 tambi&eacute;n ha planteado que las construcciones tengan una especie de bah&iacute;a para el embarque y desembarque de personas a trav&eacute;s de veh&iacute;culos, con lo cual se trata de evitar que los autos se detengan en la v&iacute;a p&uacute;blica causando mayor congestionamiento.</p>\n\n<p>&ldquo;Es usual que cuando uno llega a San Isidro tiene que estacionarse en un carril de la pista porque no hay mayor espacio&rdquo;, reconoci&oacute; el gerente municipal.</p>\n\n<p>En la gesti&oacute;n del alcalde Ra&uacute;l Cantella tambi&eacute;n se est&aacute; proponiendo la actualizaci&oacute;n del Plan Director de Vialidad, Tr&aacute;nsito y Transporte, as&iacute; como tambi&eacute;n el Plan de Movilidad Urbana Sostenible (PMUS).</p>\n\n<p>De esta forma, se contemplan los desplazamientos sostenibles (caminar, bicicleta, entre otros) en el marco de un sistema de transporte r&aacute;pido masivo e implementaci&oacute;n de corredores viales, que mitiguen el impacto vial metropolitano.</p>\n\n<p>En San Isidro se estima que hay 70 mil personas que habitan en el distrito, pero la poblaci&oacute;n flotante, es decir aquellos que acuden por temas laborales, comerciales o tur&iacute;sticos, suman un mill&oacute;n de personas, con lo que viene a ser el equivalente del distrito m&aacute;s poblado de Lima: San Juan de Lurigancho.</p>\n\n<p>&ldquo;El alcalde Cantella quiere un ordenamiento urbano sostenible en el distrito, y eso estamos trabajando&rdquo;, a&ntilde;adi&oacute; Columbus.</p>\n\n<p><em><strong>Hay un d&eacute;ficit de hasta 10 mil parqueos</strong></em></p>\n\n<p>Al tener una poblaci&oacute;n flotante de un mill&oacute;n de personas, San Isidro afronta un d&eacute;ficit de 8 mil a 10 mil estacionamientos a la fecha, manifest&oacute; el gerente municipal del distrito, Diethell Columbus.</p>\n\n<p>Para tratar de solucionarlo, el municipio est&aacute; avanzando en el proceso de concesi&oacute;n por 30 a&ntilde;os para la construcci&oacute;n de 822 estacionamientos subterr&aacute;neos a lo largo de la avenida Rivera Navarrete.</p>\n\n<p>&ldquo;Ahora estamos en una etapa de trato directo con la empresa Estacionamientos Rivera Navarrete que debe estar terminando en 20 d&iacute;as&rdquo;, detall&oacute;.</p>\n\n<p>Adem&aacute;s indic&oacute; que hay iniciativas privadas para contruir estacionamientos subterr&aacute;neos en otras arterias del distrito.</p>\n\n<p>&ldquo;Estas iniciativas privadas a&uacute;n est&aacute;n en evaluaci&oacute;n. Como hay un principio de reserva, no puedo dar mayor informaci&oacute;n&rdquo;, expres&oacute;.</p>\n\n<p><strong>Cifras y datos</strong></p>\n\n<p>Empresas. Hay 9,556 empresas con raz&oacute;n social que operan en San Isidro.</p>\n\n<p>Inspecci&oacute;n. En los pr&oacute;ximos tres meses, San Isidro inspeccionar&aacute; m&aacute;s de 280 proyectos inmobiliarios.</p>\n\n<p>Prevenci&oacute;n. La inspecci&oacute;n municipal pondr&aacute; especial &eacute;nfasis en que se cumplan las medidas preventivas para enfrentar de manera adecuada las emergencias ocasionadas por sismos.</p>\n", NULL, NULL, "1");
