INSERT INTO `paginas` VALUES ("1", "2015-09-13 12:16:34", "2015-09-13 19:32:36", NULL, "1", "3", "3", NULL, "home", "Bienvenidos", NULL, "<p>&quot;<strong>HGD CONTRATISTAS S.A.C.</strong>&quot;, es fruto de la asociaci&oacute;n de un grupo de ingenieros y arquitectos de diferentes &aacute;reas, con el objetivo com&uacute;n de aunar conocimientos y esfuerzos para desarrollar las actividades de la ingenier&iacute;a, arquitectura y formaci&oacute;n t&eacute;cnica en beneficio de los intereses de nuestros clientes.</p>\n\n<p>Con el objetivo de lograr la completa satisfacci&oacute;n de nuestros clientes contamos con un equipo multidisciplinario, que nos permiten dar una soluci&oacute;n global a sus necesidades.</p>\n\n<p>Para recibir una atenci&oacute;n personalizada no dude en contactar con nosotros.</p>\n\n<p>En nuestra web pueden encontrar la descripci&oacute;n de nuestros servicios y de algunos de nuestros proyectos destacados.</p>\n", NULL, NULL, "1");
