INSERT INTO `paginas` VALUES ("3", "2015-09-13 12:16:34", "2015-09-13 19:52:53", NULL, "1", "1", "1", NULL, "servicios", "Servicios", NULL, "<p>La experiencia captada por nuestra plana de directivas, as&iacute; como por el personal de soporte t&eacute;cnico, garantiza la calidad y eficiencia de los diversos trabajos, tales como:</p>\n\n<p>&bull; Dise&ntilde;o, Ejecuci&oacute;n, Mantenimiento y Operaci&oacute;n de subestaciones de potencia.<br />\n&bull; Dise&ntilde;o, Ejecuci&oacute;n, Mantenimiento y Operaci&oacute;n de l&iacute;neas de Subtransmisi&oacute;n y Transmisi&oacute;n.<br />\n&bull; Desarrollo de proyectos de electrotecnia en general.<br />\n&bull; Automatizaci&oacute;n de plantas industriales, as&iacute; como de construcci&oacute;n de obras civiles en general.</p>\n\n<p>Nuestra empresa, consciente de los adelantos t&eacute;cnicos y cient&iacute;ficos, pretende responder a las expectativas m&aacute;s exigentes del mercado actual, teniendo como pol&iacute;tica la satisfacci&oacute;n plena del cliente, con Cumplimiento Calidad y Eficiencia; para lo cual &ldquo;HGD CONTRATISTAS S.A.C.&rdquo; se esfuerza cada d&iacute;a en que esto se consiga, devolvi&eacute;ndoles con empe&ntilde;o y calidad la confianza depositada.</p>\n\n<p>&ldquo;HGD CONTRATISTAS S.A.C.&rdquo;, pretende tener un rol importante y trascendental en el desarrollo de nuestra naci&oacute;n, teniendo como com&uacute;n denominador el servicio eficaz y responsable para el cliente, por ello, nos permitimos poner a disposici&oacute;n en las p&aacute;ginas siguientes la cobertura de nuestra empresa y el selecto grupo humano para su desarrollo.</p>\n", NULL, NULL, "1");
