#
INSERT INTO `paginas` VALUES ("4", "2015-09-13 12:16:34", "2015-09-13 19:54:23", NULL, "1", "1", "1", NULL, "responsabilidad-social", "Responsabilidad Social", NULL, "<p>Estamos convencidos de la importancia de la responsabilidad social en el desarrollo de nuestras operaciones, contamos con una definida la pol&iacute;tica de Prevenci&oacute;n de Riesgos y una adecuada Pol&iacute;tica Ambiental la cual forma parte de nuestra conducta para con nuestros clientes, accionistas, personal y comunidad.</p>\n\n<p>Nuestro comportamiento socialmente responsable, comprende dos frentes el frente interno y el frente externo, en el frente interno el grupo objetivo es nuestro personal y en el frente externo los diferentes p&uacute;blicos que conforman la comunidad con la cual se relacionan el desarrollo de nuestros proyectos.</p>\n\n<p>Nosotros desarrollamos firmes acciones dentro de los siguientes campos: satisfacci&oacute;n, bienestar y desarrollo de nuestros recursos humanos, la prevenci&oacute;n de riesgos en el desarrollo de nuestros proyectos comprendiendo que el recurso humano es lo m&aacute;s valioso dentro de nuestra.</p>\n\n<p>Comprendemos la importancia de las buenas relaciones con la comunidad donde ejecutamos nuestros proyectos, pues somos conscientes que estos deben ejecutarse en un contexto positivo de armon&iacute;a y mutuo respeto, para lo cual nuestra empresa impulsa y ejecuta acciones que contribuyen al desarrollo sostenido en las comunidades donde ejecutamos un proyecto.</p>\n\n<p>En <strong>HGD CONTRATISTAS S.A.C.</strong>, comprendemos que el respeto por el medio ambiente as&iacute; como su conservaci&oacute;n y el cumplimiento de las normas ambientales, son trascendentales compromisos durante la ejecuci&oacute;n de todos nuestros proyectos, compromisos que asumimos con total responsabilidad.</p>\n\n<p><strong>Servicios Post-Venta</strong></p>\n\n<p><em>La eficiencia y responsabilidad que nos diferencia aseguran exceder las expectativas de nuestros clientes.</em></p>\n\n<p>Ofrecemos un servicio de garant&iacute;a extendida a todos nuestros clientes por un periodo de 6 meses, adem&aacute;s de poder ofrecerle copias de planos estructurales, planos el&eacute;ctricos y sanitarios.</p>\n", NULL, NULL, "1");
