INSERT INTO `paginas` VALUES ("5", "2015-09-13 19:18:27", "0000-00-00 00:00:00", NULL, "1", "2", "2", NULL, "quienes-somos", "QUIENES SOMOS", NULL, "<p>Somos una empresa especializada en ingenier&iacute;a, infraestructura y gerencia de proyectos; que contribuye principalmente a ampliar y mejorar los servicios de electricidad en el pa&iacute;s, a mejorar la calidad de vida de millones de personas, y a optimizar la actividad productiva en sectores tales como miner&iacute;a, industria y energ&iacute;a.</p>\n", NULL, NULL, "1");
