INSERT INTO `paginas` VALUES ("6", "2015-09-13 19:24:31", "0000-00-00 00:00:00", NULL, "1", "2", "2", NULL, "fines-y-objetivos", "Fines y Objetivos", NULL, "<p><strong>HGD CONTRATISTAS S.A.C.</strong><br />\nTiene por objeto, dedicarse a la elaboraci&oacute;n de Proyectos as&iacute; como a la ejecuci&oacute;n de obras el&eacute;ctricas, electromec&aacute;nicas, electr&oacute;nicas, civiles y afines; as&iacute; mismo a la compra, venta de representaci&oacute;n, distribuci&oacute;n y comercializaci&oacute;n de productos del ramo y toda actividad l&iacute;cita por ley.</p>\n", NULL, NULL, "1");
